import styled from "styled-components";

export const Header = styled.h1`
  text-align: center;
  color: rgb(41, 37, 37);
`;

export const CreateAccountLabelForInput = styled.label`
  display: inline-block;
  width: 100px;
  text-align: right;
`;

export const ErrorText = styled.p`
  font-size: 10px;
  color: red;
`;

export const CreateAccountButton = styled.input`
  width: 150px;
  margin-left: 60px;
  background-color: #42c41a;
  border: none;
  height: 35px;
  color: white;
`;

export const CreateAccountFormContainer = styled.div`
  box-shadow: 0px 0px 4px #888888;
  width: 450px;
`;

/*


.container-for-create-account-form-container {
  display: flex;
  justify-content: center;
  margin-top: 100px;
  flex-direction: column;
  align-items: center;
}
.inputErrorColor {
  border-bottom: 1px solid red;
  background-color: rgba(255, 0, 0, 0.171);
} */
